('2135','15','7752','Finca Varitx',Null,'Einzigartiges, komplett reformiertes Finca Anwesen aus dem 15. Jahrhundert bei Pollensa','30353','Dieses bezaubernde Finca vereint in eindrucksvoller Weise modernes, anspruchsvolles Wohnen in einem traditionellen historischen Anwesen mit viel Charme. Im Jahre 2008 wurde die Finca aufwendig reformiert und mit hochwertigen Materialen sowie modernster Technik ausgestattet.\r\nDie Finca befindet sich auf einem Grundstück von 12.000 m² mit angelegten Garten und vielen Obstbäumen. Das Haus bietet auf einer Wohnfläche von insgesamt 650 m² zwei Wohnzimmer, sechs Schlafzimmer, ein Esszimmer, eine moderne voll ausgestattete Küche, sowie verschiedene Abstellräume und eine Garage.\r\nZur hochwertigen Ausstattung gehören: Öl-Zentralheizung, Klimaanlage, eigene Wasserquelle mit Brunnen 30.000 l/h, Satelliten-TV,  Swimming Pool, Sommerküche mit Bar, Fitness-Bereich und vieles mehr.','30354','3500000','111','2013-12-10 15:40:23','110','2013-12-10 15:42:46',Null,'2038','107','969',1,'1','0',Null,Null,Null,'30355',Null,'0','0','0',Null,'2015-10-27 12:21:10',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'30356',Null,'30357',Null,'30358',Null,'30359',Null,'30360','0',0,'3');
